import { Layout} from "antd"
import {withRouter} from "react-router-dom"
const {Content} = Layout
class Home extends Component{
    render(){
        return(
            <Content>
                <h4>Home</h4>
            </Content>
        )
    }
}
export default withRouter(Home);
